import React, { useState } from 'react';
import Tab from '../../components/tabs';
// 定义图像对象的类型 暂时模拟
interface Image {
  id: number;
  url: string;
  description: string;
}
// 定义 Props 接口
interface TitleProps {
  title: string;
}
const Title: React.FC<TitleProps> = ({ title }) => {
  return (
    <div className='tw-flex tw-justify-between'>
      <div>{title}</div>
      <div>view all</div>
    </div>
  );
};
const HomeList: React.FC = () => {
  // 使用类型定义初始化图像列表状态
  const [images, setImages] = useState<Image[]>([
    { id: 1, url: 'https://via.placeholder.com/150', description: 'Image 1' },
    { id: 2, url: 'https://via.placeholder.com/150', description: 'Image 2' },
    { id: 3, url: 'https://via.placeholder.com/150', description: 'Image 3' },
  ]);
  const [activeTab, setActiveTab] = useState<number>(0);
  const tabs: string[] = ['Tab 1', 'Tab 2', 'Tab 3'];
  const handleTabChange = (index: number): void => { }
  return (
    <div>
      <Tab
        tabs={tabs}
        activeTab={activeTab}
        onTabChange={handleTabChange}
        tabStyle={{ color: 'gray', marginRight: '10px' }}
        activeTabStyle={{ color: 'blue', fontWeight: 'bold' }}
      />
      <Title title="teikegwge" />
      <div className="image-list">
        {images.map((image) => (
          <div key={image.id} className="image-item">
            <img src={image.url} alt={image.description} />
            <p>{image.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default HomeList;
